⭐️IGRAČ POLUSEZONE ZA SENIORE JE EUGENE CAMPBELL III 

Nakon odigrane utakmice u nedelju protiv Gradine, završen je prvi dio sezone za naše seniore i tim povodom vam predstavljamo igrača polusezone za seniore a to je Eugene Campbell III;

Eugene je u Brčko stigao početkom oktobra kao jedno od glavnih pojačanja za ovu sezonu;

Opravdao je očekivanja i bilježi odlične brojke u dosadašnjem dijelu sezonu;

Najbolju utakmicu Eugene je odigrao protiv ekipe Gradine u okviru 4. kola kada je u pobjedi našeg tima imao 31 poen i 5 asistencija;

Za sada njegova statistika izgleda ovako:
20.12 poena po utakmica;
3.3 skoka po utakmici;
4.5 asistencija po utakmici;

Nadamo se još boljim partijama Eugena u nastavku sezone 💪

